**Describe the bug**
"Run" skipped inference when using DML allocator to create output OrtValue.

**Urgency**
None

**System information**
- Not platform-specified
- ONNX Runtime installed from source:
- ONNX Runtime version: 2021/12/08 master branch,, build with --use_dml
- GPU model and memory: any

**To Reproduce**
Ort::MemoryInfo memory_info_memory("DML", OrtAllocatorType::OrtDeviceAllocator, 0, OrtMemTypeDefault);
memory_allocator = new Ort::Allocator(session, memory_info_memory);
std::vector<Ort::Value> inputs;
inputs.push_back(std::move(Ort::Value::CreateTensor<float>(*memory_allocator, input_shape, 1)));
std::vector<Ort::Value> outputs;
outputs.push_back(std::move(Ort::Value::CreateTensor<float>(*memory_allocator, output_shape, 1)));

// following line could submit Dml command list to D3D12CommandQueue
auto res = session.Run(runOpt, names, inputs.data(), sizeof(names) / sizeof(const char*), outNames, 1);

// following line will not submit Dml command list to D3D12CommandQueue
res = session.Run(runOpt, names, inputs.data(), sizeof(names) / sizeof(const char*), outNames, outputs.data(), 1);

**Expected behavior**
Inference is running correctly on providing output OrtValue created by DML allocator

**Additional context**
The issue is Dml Execution Provider queue OpKernel into commandList, and submit commandList to commandQueue is triggered by Flush in ReadbackFromGpu.
On using DML allocator to create the input/output tensor, onnxruntime skip input/output copy since input/output tensor and graph are on same device, which results in commandList submission also skipped.
A quick fix could be implementing OnRunEnd for Dml::ExecutionProvider.
